# https://www.hackerrank.com/challenges/palindrome-index/problem

def is_palindrome(s):
    half_len = int(len(s) / 2)
    return all([s[i] == s[-1 - i] for i in range(half_len)])


def palindromeIndex(s):
    if is_palindrome(s):
        return -1
    sr = s[-1::-1]
    for i in range(len(s)):
        if s[i] != sr[i]:
            stemp = list(s)
            stemp.pop(i)
            if is_palindrome(stemp):
                return i
            stemp = list(sr)
            stemp.pop(i)
            if is_palindrome(stemp):
                return len(s) - i - 1
            return -1
    return -1


if __name__ == '__main__':
    assert palindromeIndex("aaab") == 3
    assert palindromeIndex("baa") == 0
    assert palindromeIndex("aaa") == -1

    assert palindromeIndex("") == 24988
    assert palindromeIndex("") == 28693
    assert palindromeIndex("") == 35287
